describe("Core element tests",function(){it("should transition model properties",function(){var a=new Chart.Element({_model:{numberProp:0,numberProp2:100,_underscoreProp:0,stringProp:"abc",objectProp:{myObject:true},colorProp:"rgb(0, 0, 0)"}});a.transition(0.25);expect(a._view).toEqual(a._model);expect(a._start).toEqual(a._model);expect(a._view.objectProp).toBe(a._model.objectProp);expect(a._start.objectProp).toEqual(a._model.objectProp);a._model.numberProp=100;a._model.numberProp2=250;a._model._underscoreProp=200;a._model.stringProp="def";a._model.newStringProp="newString";a._model.colorProp="rgb(255, 255, 0)";a.transition(0.25);expect(a._view).toEqual({numberProp:25,numberProp2:137.5,_underscoreProp:0,stringProp:"def",newStringProp:"newString",objectProp:{myObject:true},colorProp:"rgb(64, 64, 0)",})})});